import React from 'react';
import Iframe from 'react-iframe';

const Project = () => {
    return (
        <div>
        <Iframe url="http://www.youtube.com/embed/xDMP3i36naA"
        width="450px"
        height="450px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"/>
        </div>
    )
}

export default Project
